	(10, 19, '<p>Giảng Viên:Cô Nguyễn Thị Hạnh</p><p>Số tiết:5</p><p>Phòng:111C(59SV)</p>', '2022-11-14 13:00:00', '2022-11-14 17:50:00', '2023-03-02 11:01:44', NULL, 'Rèn luyện kĩ năng giao tiếp, thuyết trình, hoạt động nhóm', 3, 0),
	(11, 21, '<p>Giảng Viên :Cô Nguyễn Thị Quỳnh Hoa</p><p>Số tiết :5</p><p>Phòng:Hội Trường K1(220SV)</p>', '2022-11-14 08:00:00', '2022-11-14 11:00:00', '2023-03-02 11:06:53', NULL, 'Toạ đàm về kĩ năng viết e-mail, CV', 3, 0),
	(12, 23, '<p><strong style="background-color: transparent;">a. MỤC ĐÍCH, Ý NGHĨA</strong></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Thiết thực phong trào tháng thi đua kỷ niệm ngày nhà giáo Việt Nam 20/11.</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Tạo một sân chơi văn hóa, giao lưu và giải trí lành mạnh; phát huy tinh thần đoàn kết, sáng tạo, nâng cao nhận thức về trí - thể - mỹ; góp phần kết nối học sinh, sinh viên khoa CNTT.</span></li></ul><p><strong style="background-color: transparent;">b. ĐỐI TƯỢNG THAM GIA</strong></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Sinh viên khoa Công nghệ thông tin – Trường Đại học sư phạm Hà Nội.</span></li></ul><p><br></p>', '2022-11-16 08:00:00', '2022-11-16 08:59:00', '2023-03-02 20:27:47', NULL, 'Phần thi: Ba môn phối hợp WEP', 1, 0),
	(13, 25, '<p class="ql-align-justify"><span style="background-color: transparent; color: rgb(34, 34, 34);">Dẫn dắt và cung cấp một số thông tin về lễ kỷ niệm 20 năm thành lập Khoa.</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(34, 34, 34);">[Đây là cơ hội để các em thể hiện khả năng sáng tạo và trí tưởng tượng của mình, đồng thời gửi gắm các thông điệp để hướng tới kỷ niệm 20 năm thành lập Khoa Công nghệ thông tin 2003 - 2023]</span></p><p><br></p><p><br></p>', '2022-11-16 09:00:00', '2022-11-16 11:00:00', '2023-03-02 20:35:45', NULL, 'Phần thi: Thiết kế sản phẩm truyền thông đa phương tiện', 1, 0),
	(14, 27, '<ol><li><strong style="background-color: transparent;">Đối tượng: Mỗi một đội dự thi tương ứng với 1 lớp trong Khoa CNTT (Không giới hạn số lượng thành viên)</strong></li><li><strong style="background-color: transparent;">Chủ đề: <em>“Giới thiệu về khoa CNTT”</em></strong></li><li><strong style="background-color: transparent;">Nôi dung phần thi:</strong></li></ol><p class="ql-align-justify">	<span style="background-color: transparent; color: rgb(34, 34, 34);">Mỗi lớp dàn dựng một chương trình giới thiệu về khoa mình dưới các hình thức nghệ thuật:&nbsp;</span></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Hát, hò, vè, rap</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Nhảy, múa</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Kịch</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Kể chuyện</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Ngâm thơ</span></li><li class="ql-align-justify"><span style="background-color: transparent;">&nbsp;….</span></li></ul><p><br></p>', '2022-11-16 07:30:00', '2022-11-16 08:59:00', '2023-03-02 20:49:29', NULL, 'Phần thi: Chào hỏi', 1, 0),
	(15, 29, NULL, '2022-11-16 09:00:00', '2022-11-16 11:30:00', '2023-03-03 21:58:02', NULL, 'Phần thi: Khởi nghiệp', 1, 0),
	(16, 31, '<h1 class="ql-align-justify"><strong style="background-color: transparent; color: rgb(0, 0, 0);">Mô tả phần thi:</strong></h1><ul><li class="ql-align-justify"><span style="background-color: transparent;">Ban giám khảo đóng vai trò là các nhà tuyển dụng đưa ra các vị trí cần tuyển dụng.&nbsp;</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Phần thi có 2 vòng thi:</span></li><li class="ql-indent-1 ql-align-justify"><span style="background-color: transparent;">Vòng tuyển chọn:</span></li><li class="ql-indent-1 ql-align-justify"><span style="background-color: transparent;">Vòng phỏng vấn: </span></li></ul><p><br></p>', '2022-11-16 13:30:00', '2022-11-16 15:30:00', '2023-03-04 09:49:55', NULL, 'Phần thi: Phỏng vấn tuyển dụng', 1, 1),
	(17, 33, '<p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 26, 51);">1) </span><span style="background-color: transparent; color: rgb(0, 0, 0);">Mỗi lớp thành lập 01 đội gồm 02 sinh viên, trong đó có 1 trưởng nhóm&nbsp;</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">2) </span><span style="background-color: transparent; color: rgb(255, 0, 0);">Chủ đề</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: </span><span style="background-color: transparent; color: rgb(0, 26, 51);">Hiểu biết về trường, về khoa, về chuyên môn Tin học.</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">3) </span><span style="background-color: transparent; color: rgb(255, 0, 0);">Thành phần bắt buộc có mặt</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: tất các đội tham dự. Thành phần khuyến khích: Tất cả các lớp. (</span><span style="background-color: transparent; color: rgb(255, 0, 0);">Chú ý</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: Phải ở lại tham dự đến hết cuộc thi; Đội nào/ lớp nào về sớm sẽ bị trừ điểm)</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">4) </span><span style="background-color: transparent; color: rgb(255, 0, 0);">Hình thức thi</span><span style="background-color: transparent; color: rgb(0, 26, 51);">: Trắc nghiệm trên web. BTC sẽ cung cấp 1 tài khoản, sau đó vào phòng thi chung. </span></p>', '2022-11-16 15:31:00', '2022-11-16 16:30:00', '2023-03-04 09:55:44', NULL, 'Phần thi: Hiểu biết', 1, 0),
	(18, 35, '<p><strong style="background-color: transparent;">a. MỤC ĐÍCH, Ý NGHĨA</strong></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Thiết thực phong trào tháng thi đua kỷ niệm ngày nhà giáo Việt Nam 20/11.</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Tạo một sân chơi văn hóa, giao lưu và giải trí lành mạnh; phát huy tinh thần đoàn kết, sáng tạo, nâng cao nhận thức về trí - thể - mỹ; góp phần kết nối học sinh, sinh viên khoa CNTT.</span></li></ul><p><strong style="background-color: transparent;">b. ĐỐI TƯỢNG THAM GIA</strong></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Sinh viên khoa Công nghệ thông tin – Trường Đại học sư phạm Hà Nội.</span></li></ul><p><br></p>', '2022-11-17 08:00:00', '2022-11-17 12:00:00', '2023-03-04 09:59:47', NULL, 'Phần thi: Bảo trì máy tính', 1, 0),
	(19, 37, '<p class="ql-align-justify">	<span style="background-color: transparent; color: rgb(0, 0, 0);">Trong tuần NVSP, khoa CNTT tổ chức bài thi dạng FE cho sinh viên năm 3 và năm 4. Sinh viên sẽ có cơ hội làm quen với hình thức thi, dạng bài thi của kỳ thi lấy chứng chi FE do Trung tâm ươm tạo và Đào tạo công nghệ cao HITC tổ chức.</span></p><p class="ql-align-justify">	<span style="background-color: transparent; color: rgb(0, 0, 0);">Nội dung kiến thức trong bài thi là kiến thức sinh viên đã được học trong các môn chuyên ngành. SV đăng ký tham gia thi sẽ được thêm vào khóa học “Ôn tập CC Công nghệ thông tin Nhật Bản” trên hệ thống cst.hnue.edu.vn. SV sẽ được tham gia một số buổi ôn tập do GV của khoa hướng dẫn.</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(47, 84, 150);">Hình thức thi</span></p><p class="ql-align-justify">	<span style="background-color: transparent; color: rgb(0, 0, 0);">Bài thi dạng làm trắc nghiệm trên cst.hnue.edu.vn. Bài thi gồm 2 phần:</span></p><ul><li class="ql-align-justify"><span style="background-color: transparent;">Phần 1: Trắc nghiệm – Gồm các câu hỏi có 4 đáp án, chọn một đáp án đúng.</span></li><li class="ql-align-justify"><span style="background-color: transparent;">Phần 2: Bài tập – Mỗi bài tập có từ 2 đến 3 câu hỏi. Các câu hỏi có thể có khoảng 2 – 3 phần. Mỗi phần trả lời ở dạng trắc nghiệm chọn một đáp án đúng từ 3&nbsp; - 5 đáp án đã cho.</span></li></ul><p class="ql-align-justify">	<span style="background-color: transparent; color: rgb(0, 0, 0);">Các thí sinh sẽ được gán số báo danh, chia phòng, nhận đề thi in trên giấy và thực hiện trả lời trên máy tính.</span></p><p><br></p><p><br></p>', '2022-11-15 08:00:00', '2022-11-15 11:00:00', '2023-03-04 10:06:46', NULL, 'Phần thi: Chứng chỉ CNTT', 1, 0),
	(20, 39, NULL, '2022-11-17 13:00:00', '2022-11-17 17:00:00', '2023-03-04 10:19:29', NULL, 'Phần thi: Lập trình Scratch', 1, 0),
	(21, 41, '<p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">1) </span><span style="background-color: transparent; color: rgb(255, 0, 0);">Chủ đề</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: Chọn bài học tùy ý trong các chủ đề của Tin học 10 phần cốt lõi hoặc phần chuyên đề.</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">2) Mỗi lớp thành lập 01 đội gồm 05 sinh viên, trong đó có 1 trưởng nhóm và 1 thư kí.&nbsp;</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">3) </span><span style="background-color: transparent; color: rgb(255, 0, 0);">Thành phần bắt buộc có mặt</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: các đội/nhóm được vào chung kết. Thành phần khuyến khích: Tất cả các SV lớp SP K69 và K70AK. (</span><span style="background-color: transparent; color: rgb(255, 0, 0);">Chú ý</span><span style="background-color: transparent; color: rgb(0, 0, 0);">: Phải ở lại tham dự đến hết cuộc thi; Đội nào/ lớp nào về sớm sẽ bị trừ điểm)</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">- Mỗi đội sẽ cử một bạn trả lời vấn đáp hoặc được yêu cầu trình bày về sản phẩm. Vấn đáp ở đây là BGK muốn hỏi để làm rõ thêm một số nội dung. Trình bày bài giảng ở đây không phải dạy mà là giải thích về bài giảng của mình.&nbsp;</span></p><p class="ql-align-justify"><span style="background-color: transparent; color: rgb(0, 0, 0);">- Sản phẩm dự thi bài giảng e-Learning được thực hiện bằng các công cụ tạo bài giảng (authoring tools) như iSpring Suite, Active Presenter, Adobe Captivate,…</span></p><p><br></p><p><br></p>', '2022-11-15 08:00:00', '2022-11-15 12:00:00', '2023-03-04 10:26:49', NULL, 'Phần thi: THIẾT KẾ BÀI GIẢNG  E-LEARNING', 1, 0),
	(22, 45, '<p><span style="color: rgb(0, 0, 0);">Giáo viên phụ trách:</span></p><p><span style="color: rgb(0, 0, 0);">-Thầy Hải Long</span></p><p><span style="color: rgb(0, 0, 0);">-Thầy Khắc Ân </span></p><p><span style="color: rgb(0, 0, 0);">Số lượng: 05 SV</span></p><p><span style="color: rgb(0, 0, 0);">Thời lượng: không quá 03 phút</span></p><p><span style="color: rgb(0, 0, 0);">Nội dung: Thông tin về Khoa, trường ĐHSP HN dành cho PH, HS, GV THPT để phục vụ tuyển sinh</span></p>', '2021-11-16 08:00:00', '2022-11-16 12:00:00', '2023-03-08 00:06:12', NULL, 'Phần thi Clip truyền thông', 2, 0),
	(23, 47, '<p>Giáo viên phục trách:</p><p><span style="color: rgb(0, 0, 0);">-Thầy Ba Chín</span></p><p><span style="color: rgb(0, 0, 0);">-Cô Xuyến</span></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Số lượng: 07 SV (có thể cử thêm SV)</span></p><p>Nội dung: giới thiệu về Khoa (dưới nhiều hình thức: hát, múa, đóng kịch, …)</p><p>Thời gian: 03 phút (quá 10 giây bị trừ 1 điểm)</p>', '2022-11-17 07:00:00', '2022-11-17 12:00:00', '2023-03-08 00:15:15', NULL, 'Phần Thi Chào Hỏi', 2, 0),
	(24, 49, '<p><span style="color: rgb(0, 0, 0);">Giáo viên phụ trách:</span></p><p><span style="color: rgb(0, 0, 0);">-Thầy Trung Khánh</span></p><p><span style="color: rgb(0, 0, 0);">-Cô Thu Bình</span></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Thời gian: 1’ suy nghĩ, 2’ trả lời (khuyến khích hình thức nhập vai)</span></p><p>Câu hỏi thuộc gói tình huống Trung học</p>', '2022-11-17 07:00:00', '2022-11-17 12:00:00', '2023-03-08 00:23:59', NULL, 'Phần Thi Giải quyết tình huống sư phạm', 2, 0),
	(25, 56, '<p>Giáo viên phụ trách:</p><p>-Thầy Trung Khánh</p><p>-Cô Thu Bình</p><p><span style="color: rgb(0, 0, 0);">Hình thức: trắc nghiệm</span></p><p><span style="color: rgb(0, 0, 0);">Số lượng: 10 câu (2 câu TA) 5 giây suy nghĩ, mỗi câu trả lời đúng được 2 điểm</span></p>', '2021-11-07 07:00:00', '2022-11-07 12:00:00', '2023-03-09 08:27:47', NULL, 'Hiểu Biết Sư Phạm', 2, 0),
	(26, 58, '<p>Giáo viên phụ trách:Thầy Trung Khánh</p><p>-Cô Thu Bình</p><p><span style="color: rgb(0, 0, 0);">Đội thi: 5 đội có điểm cao nhất sau 3 phần thi trên</span></p><p><span style="color: rgb(0, 0, 0);">Nội dung: 10 chủ đề</span></p><p><span style="color: rgb(0, 0, 0);">Thời gian: tối đa 3 phút</span></p><p><br></p>', '2022-11-07 07:00:00', '2022-11-07 12:00:00', '2023-03-09 08:45:47', NULL, 'Phần Thi Hùng Biện', 2, 0);
