REPLACE INTO `loai_tieu_chi` (`id`, `name`, `id_tieu_chi_big_type`, `created_at`, `updated_at`) VALUES
	(1, 'Học tập và làm theo tư tưởng, đạo đức, phong cách Hồ Chí Minh', 1, NULL, NULL),
	(2, 'Theo dõi, nắm bắt thông tin thời sự, chính trị, xã hội và đấu tranh với những luận điểm xuyên tạc, âm mưu “diễn biến hoà bình”', 1, NULL, NULL),
	(3, 'Về phẩm chất đạo đức', 2, NULL, NULL),
	(4, 'Về lối sống, tác phong của đoàn viên', 2, NULL, NULL),
	(5, 'Về chấp hành nội quy và thực hiện các chuẩn mực văn hoá giảng đường', 2, NULL, NULL),
	(6, 'Chấp hành pháp luật', 2, NULL, NULL),
	(7, 'Chấp hành sự phân công của ban chấp hành chi đoàn ', 5, NULL, NULL),
	(8, 'Bảo vệ quyền và lợi ích hợp pháp, chính đáng của tổ chức Đoàn, cán bộ Đoàn và đoàn viên, thanh thiếu nhi*', 5, NULL, NULL),
	(9, 'Ý thức tham gia các hoạt động công ích, tình nguyện, công tác xã hội trong nhà trường', 3, NULL, NULL),
	(10, 'Ý thức tham gia các hoạt động tuyên truyền, phòng chống tội phạm và các tệ nạn xã hội trong nhà trường', 3, NULL, NULL),
	(11, 'Ý thức chấp hành và tham gia tuyên truyền các chủ trương của Đảng, chính sách, pháp luật của Nhà nước', 4, NULL, NULL),
	(12, 'Có ý thức tham gia các hoạt động xã hội, có thành tích được ghi nhận, biểu dương, khen thưởng', 4, NULL, NULL),
	(13, 'Có tinh thần chia sẻ, giúp đỡ người gặp khó khăn, hoạn nạn', 4, NULL, NULL),
	(14, 'Ý thức, tinh thần, thái độ, uy tín và đạt hiệu quả công việc khi sinh viên được phân công nhiệm vụ quản lý lớp, các tổ chức Đảng, Đoàn Thanh niên, Hội Sinh viên và các tổ chức khác trong Nhà trường', 5, NULL, NULL),
	(15, 'Kỹ năng tổ chức, quản lý lớp, các tổ chức Đảng, Đoàn Thanh niên, Hội Sinh viên và các tổ chức khác trong Nhà trường', 5, NULL, NULL),
	(16, 'Hỗ trợ và tham gia tích cực các hoạt động chung của tập thể lớp, khoa, trường', 5, NULL, NULL),
	(17, 'Đạt thành tích đặc biệt trong học tập, rèn luyện', 5, NULL, NULL);
