REPLACE INTO `tieu_chi` (`id`, `id_loai_tieu_chi`, `name`, `max_score`, `created_at`, `updated_at`, `type`, `note`) VALUES
	(1, 1, 'Gương mẫu thực hiện các chuẩn mực theo tư tưởng, đạo đức, phong cách Hồ Chí Minh, có ảnh hưởng tích cực tới đoàn viên khác trong chi đoàn', 5.00, NULL, NULL, 1, '(-1 điểm/ 1 lần vắng không phép, -2 điểm/ 3 buổi đi muộn'),
	(2, 1, 'Thực hiện đúng các chuẩn mực theo tư tưởng, đạo đức, phong cách Hồ Chí Minh', 3.00, NULL, NULL, NULL, NULL),
	(3, 1, 'Thường xuyên có biểu hiện chưa chuẩn mực theo tư tưởng, đạo đức, phong cách Hồ Chí Minh: 0 điểm', 0.00, NULL, NULL, NULL, '(+1,5 có đề tài được báo cáo)'),
	(4, 2, 'Thường xuyên theo dõi, nắm bắt thông tin thời sự, chính trị, xã hội của địa phương, đất nước, khu vực và quốc tế trên các phương tiện thông tin đại chúng chính thống; đấu tranh với những luận điểm xuyên tạc, âm mưu “diễn biến hoà bình” nhằm phá hoại sự nghiệp của Đảng, của dân tộc; không bị tác động bởi những thông tin tiêu cực trên mạng internet', 5.00, NULL, NULL, NULL, '(+0,5 được giải NCKH)'),
	(5, 2, 'Có hành vi chia sẻ những thông tin không chính thống, tuyên truyền những luận điểm xuyên tạc về Đảng, Nhà nước, Chính quyền, các tổ chức đoàn thể', 0.00, NULL, NULL, NULL, '(+1,5 tham gia 1 CLB, ngoại khóa)'),
	(6, 3, 'Yêu thương quý trọng con người, sống có nghĩa tình, trung thực, trách nhiệm, nhân ái; có tinh thần đoàn kết, dũng cảm bảo vệ cái đúng, tiến bộ; đấu tranh với cái sai, lạc hậu, cản trở sự phát triển', 4.00, NULL, NULL, NULL, '(+0,5 nhận giấy khen ngoại khóa, CLB)'),
	(7, 3, 'Có hành vi vi phạm chuẩn mực đạo đức', 0.00, NULL, NULL, 1, '(-1 điểm / vắng thi)'),
	(8, 4, 'Sống giản dị, lành mạnh, chân thành, biết lắng nghe, chia sẻ, cộng đồng trách nhiệm, không mắc các tệ nạn xã hội', 4.00, NULL, NULL, 3, NULL),
	(9, 4, ' Mắc một trong các tệ nạn xã hội', 0.00, NULL, NULL, 1, '(-1 điểm / vắng 1 buổi)'),
	(10, 5, 'Chấp hành tốt nội quy, có hành vi phù hợp với chuẩn mực văn hoá giảng đường và có ảnh hưởng tích cực tới những đoàn viên khác', 4.00, NULL, NULL, NULL, '(+1 điểm/ tham gia 1 thi NVSP cấp khoa, cấp trường'),
	(11, 5, 'Không vi phạm nội quy, không có hành vi lệch chuẩn', 2.00, NULL, NULL, NULL, '(+1 điểm/ đạt giải thừ 3 trở lên)'),
	(12, 5, 'Không đáp ứng các yêu cầu trên', 0.00, NULL, NULL, NULL, NULL),
	(13, 6, 'Nghiêm chỉnh chấp hành pháp luật; vận động gia đình, bạn bè cùng tham gia thực hiện:', 4.00, NULL, NULL, 3, NULL),
	(14, 6, 'Thực hiện tốt nội quy, quy định của Đảng, Bộ Giáo dục và Đào tạo, của trường', 2.00, NULL, NULL, NULL, NULL),
	(15, 6, 'Không có hành vi vi phạm pháp luật', 0.00, NULL, NULL, NULL, NULL),
	(16, 7, 'Chấp hành và thực hiện nghiêm túc các công việc, hoạt động theo sự phân công của BCH chi đoàn:', 5.00, NULL, NULL, NULL, NULL),
	(17, 7, 'Chấp hành theo sự phân công của BCH chi đoàn, trường hợp không chấp hành cần có lý do được tập thể thông qua', 2.00, NULL, NULL, NULL, NULL),
	(18, 7, 'Không chấp hành phân công (không có lý do được tập thể thông qua', 0.00, NULL, NULL, 3, 'Khiển trách: (-10 điểm/ vi phạm); Cảnh cáo: (-15 điểm/ vi phạm); Đình chỉ thi: (-25 điểm/ vi phạm)'),
	(19, 8, 'Phát ngôn đúng quan điểm, chủ trương của Đảng, của Đoàn; biết nắm bắt thông tin dư luận xã hội, có khả năng phản biện xã hội nhằm bảo vệ quyền và lợi ích hợp pháp, chính đáng của tổ chức Đoàn, cán bộ Đoàn và đoàn viên, thanh thiếu nhi, nhất là trên không gian mạng Internet', 4.00, NULL, NULL, 3, 'Khiển trách: (-10 điểm/ vi phạm); Cánh cáo: (-15 điểm/ vi phạm); Đình chỉ học tập: (-25 điểm/ vi phạm)'),
	(20, 8, 'Phát ngôn đúng quan điểm, chủ trương của Đảng, của Đoàn', 2.00, NULL, NULL, NULL, NULL),
	(21, 8, 'Có phát ngôn, bài viết, hành vi tuyên truyền… sai quan điểm, chủ trương của Đảng, của Đoàn', 0.00, NULL, NULL, NULL, NULL),
	(22, 7, 'Có hành vi giúp đỡ, đấu tranh để đảm bảo nội quy, quy chế khác (ngoài ngành) được thực hiện', 3.00, NULL, NULL, NULL, NULL),
